select * from academico_aluno alu 
where 



-- universus - alucurriculo
-- educat - curriculos_aluno

select * from carga_universus.dbo.alucurriculo  cur join carga_universus.dbo.aluno alu on (cur.CODALUNO = alu.CODALUNO and 
                                                                                           cur.CODESCOLA = alu.CODESCOLA)
where alu.CODALUNOESCOLA = '1190.000031'


select  ecur.ano_admissao, ecur.periodo_admissao, ucur.ANO, ucur.REGIME, ucur.periodo,  * 
-- begin tran update ecur set ecur.periodo_admissao = ucur.periodo
  from curriculos_aluno ecur join carga_universus.dbo.alucurriculo  ucur on (json_value(ecur.atributos, '$.universus_key.codescola')    = ucur.codescola and 
                                                                             json_value(ecur.atributos, '$.universus_key.codaluno')     = ucur.CODALUNO  and
																			 json_value(ecur.atributos, '$.universus_key.codcurriculo') = ucur.CODCURRICULO)
where (periodo_admissao is null or 
      ano_admissao is null) 

